import React, { useState } from 'react';

function Board() {
  return (
    <div>
      <div class="board-row">
        <Square num={0} />
        <Square num={1} />
        <Square num={2} />
      </div>
      <div class="board-row">
        <Square num={3} />
        <Square num={4} />
        <Square num={5} />
      </div>
      <div class="board-row">
        <Square num={6} />
        <Square num={7} />
        <Square num={8} />
      </div>
    </div>
  );

}
function Square(props) {
  return (
    <button class="square">{props.num}</button>
  );

}
function Tiktak() {
  return (
    <div>
      <h2>Tiktak</h2>
      <div class="game-board">
        <Board />
      </div>
      <div class="game-info">

      </div>
    </div>
  )
}


export default Tiktak;
